description:
Categories: Lesbian, All Girl, Romance, Feature
Cast: Mischa Brooks, Rilynn Rae, Carmen Callaway, Skylar Green, Ela Darling, Phoenix Askani, Nikki Hearts
Director: Nikki Hearts
Synopsis: The lesbian social circle of Downtown Los Angeles is never short on drama and sexy encounters with one another, and one another's girlfriends. Following a breakup between Nikki Hearts and Mischa Brooks, watch as a ripple affect of cheating, hookups and of course passionate sex between lovers unfolds.

